import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { LoginComponent } from './login.component';

@NgModule({
  imports: [
    CommonModule
  ],
  declarations: [LoginComponent],
  // Agregado
  exports: [LoginComponent]
})
export class LoginModule { }
